import backgroundImg from '/Users/MandyNemshin/Desktop/Duke/Technify/FinalProj/tester/src/background.png';
import record from '/Users/MandyNemshin/Desktop/Duke/Technify/FinalProj/tester/src/record.png';

const firstBackgroundStyle = {
  backgroundImage: `url(${backgroundImg})`,
  backgroundSize: 'cover',
  backgroundPosition: 'left',
  height: '100px',
  width: '60%' // Adjust to fit both images side-by-side
};

const secondBackgroundStyle = {
  backgroundImage: `url(${record})`,
  backgroundSize: 'cover',
  backgroundPosition: 'right',
  height: '70px',
  width: '40%'
};

function App() {
  const containerStyle = {
    display: 'flex'
  };

  return (
    <div style={containerStyle}>
      <div style={firstBackgroundStyle}></div>
      <div style={secondBackgroundStyle}></div>
    </div>
  );
}

export default App;
